import { LinkedList } from './LinkedList'

export class LinkedListComp extends React.Component {
    constructor() {
        super();
        this.new = this.new().bind(this)
        this.ll = null
    }

    new(e) {
        let subject = document.getElementById("newSubject")
        let amount = document.getElementById("newAmount")

        console.log(subject)
        console.log(amount)


        this.ll = new LinkedList(subject.value, amount.value)

        subject.value = ''
        amount.value = ''
    }

    show(e) {
        let display = document.getElementById('showlist')
    display.innerHTML = this.ll.show() 
   }


    render() {
        return(
            <div>
                <h1>Hello World!</h1>
                <button id="new" onClick={this.new}>New</button>
                <input id="newSubject" value=" " type='text' />
                <br />
                <button id="add">Add</button>
                <input id="newAmount" type='text' value=" " />
                <br />
                <button id="showall" onClick="show">Show All</button>
                <div id="showlist" className=""> </div>
            </div>
        )
    }
}
